import { FETCH_POST, NEW_POST } from './type';


export const fetchPosts = () => dispatch => {
    fetch('http://localhost:5000/api/post', {
        method: 'GET',
        headers: {
            "Content-type": "application/json; charset=UTF-8"
        }
    })
        .then(response => response.json())
        .then(json => dispatch({
            type: FETCH_POST,
            payload: json
        }));
}
